import Link from 'next/link';
import LogoStyles from './styles/LogoStyles';


const Footer = () => (
    <FooterStyles>
        <LogoStyles>
            <Link href="/">
                <a>Free Spirits</a>
            </Link>
        </LogoStyles>
    </FooterStyles>
);

export default Footer;
